Transactions represent several function call invocations that are atomic. If any function call fails, then the entire tx is rejected. Additionally some smart contracts might impose additional conditions on the transaction's structure or other function calls (such as their call data). struct Transaction { func_calls: Vec<(ContractFuncId, Box<FuncCallBase>)>
} Function calls represent mutations of the current active state to a new state. Each function call invocation is ran using its own state_transition() function. mod dao_contract { ... // DAO::mint() in the smart contract pseudocode mod mint { ... fn state_transition(states: &StateRegistry, func_call_index: usize, parent_tx: &Transaction) -> Result<Update> { // we could pass the func_call, index and parent_tx also let (_, func_call) = parent_tx.func_calls[func_call_index]; ... } }
} The state_transition() has access to the entire atomic transaction to enforce correctness. For example chaining of function calls is used by the DAO::exec() smart contract function to execute moving money out of the treasury using Money::pay() within the same transaction. Additionally StateRegistry gives smart contracts access to the global states of all smart contracts on the network, which is needed for some contracts. Note that during this step, the state is not modified. Modification happens after the state_transition() is run for all function call invocations within the transaction. Assuming they all pass successfully, the updates are then applied at the end. This ensures atomicity property of transactions. mod dao_contract { ... // DAO::mint() in the smart contract pseudocode mod mint { ... // StateRegistry is mutable fn apply(states: &mut StateRegistry, update: Update) { ... } }
} The transaction verification pipeline roughly looks like this: Loop through all function call invocations within the transaction: Lookup their respective state_transition() function based off their contract_func_id. The contract_func_id corresponds to the contract and specific function, such as DAO::mint(). Call the state_transition() function and store the update. Halt if this function fails. Loop through all updates Lookup specific apply() function based off the contract_func_id. Call apply(update) to finalize the change.

